import styled from "styled-components";

export const Inner_warpper = styled.div`
  position: relative;

`
export const Inner_grid = styled.div`
width:1190px;
margin:0 auto;
height:480px;
`
export const Inner_left = styled.div`
    float: left;
    height: 480px;
    margin-right: 10px;
`
